    "source": "// SPDX-License-Identifier: MIT\r\npragma solidity >=0.7.0 <0.9.0;\r\n\r\ninterface IDepositContract {\r\n    function connect(address) external;\r\n    function getDeposit(uint) external view returns (WithdrawContract.Deposit memory);\r\n    function withdraw(uint, address) external;\r\n}\r\n\r\ncontract WithdrawContract {\r\n    \r\n    struct Deposit {\r\n        uint index;\r\n        string hash;\r\n        uint amount;\r\n        uint fee;\r\n        string ref;\r\n        address owner;\r\n        bool withdrawn;\r\n        bool reversed;\r\n        bool blocked;\r\n        address withdrawer;\r\n        uint timestamp;\r\n        bool active;\r\n    }\r\n    \r\n    address depositAddress;\r\n    address withdrawer;\r\n    address owner;\r\n    \r\n    constructor() {\r\n        owner = msg.sender;\r\n        IDepositContract(depositAddress).connect(msg.sender);\r\n    }\r\n    \r\n    // Begin -------------- Init -----------------\r\n    function connect(address depAddr) external {\r\n        require(msg.sender == owner, \"Access Denied.\");\r\n        depositAddress = depAddr;\r\n        IDepositContract(depositAddress).connect(address(this));\r\n    }\r\n    \r\n    function setWithdrawer(address _withdrawer) external {\r\n        require(msg.sender == owner, \"Access Denied.\");\r\n        withdrawer = _withdrawer;\r\n    }\r\n    // End   -------------- Init --------------\r\n    \r\n    // Begin -------------- Withdraw --------------\r\n    function request(uint index) external view returns(Deposit memory) {\r\n        require(msg.sender == withdrawer, \"Access Denied.\");\r\n        return IDepositContract(depositAddress).getDeposit(index);\r\n    }\r\n    \r\n    function withdraw(uint index, address to) external {\r\n        require(msg.sender == withdrawer, \"Access Denied.\");\r\n        IDepositContract(depositAddress).withdraw(index, to);\r\n    }\r\n    // End   -------------- Withdraw --------------\r\n}",
